412.source:
function setup(makeCleanForDownload) {
// call with true to avoid instantiated letters that waste download space
// this.setup(true)
/* -- this goes in initializer...
	var panel = WorldMorph.current().addMorph(
		new Morph(new lively.scene.Rectangle(new Rectangle(100, 100, 800, 600))));
	panel.setup();
*/
this.removeAllMorphs();  // for restart...
this.fallingLetters = [];
this.activeLetters = [];
this.letterSource = [];

this.toPts = 0.75;  // ugh
this.stopStepping();
this.paused = false;
this.nMissed = 0;
this.pointsMissed = 0;
this.pointsUsed = 0;
this.usedWords = [];
if (makeCleanForDownload) {
    this.levels = [ {caption: 'not so quick', beltSize: 3, rackSize: 9,
                        bestWord: '', bestWordScore: 0, bestGameScore:0},
                    {caption: 'quick', beltSize: 3, rackSize: 8,
                        bestWord: '', bestWordScore: 0, bestGameScore:0},
                    {caption: 'super quick', beltSize: 2, rackSize: 8,
                        bestWord: '', bestWordScore: 0, bestGameScore:0} ];
    this.level = this.levels[1];
//    this.bestGameScore = 0;  // this changes to use levels
}
if (!this.wordList && !(URL.source.getQuery()['noLoad'])) this.doLoadWordList(true);
this.rackSize = this.level.rackSize;
this.beltSize = this.level.beltSize;
this.numLetters = 103;
this.letterScore = 0;
this.wordScore = 0;
this.totalScore = 0;
this.bestWordScore = 0;
this.bestWord = " ";

// Letter prototype
this.setFill(Color.orange.darker());
var letter = this.setupLetterPrototype(2);
this.ticksPerSec = 20;  // number of milliseconds per tick
this.xStep = - this.letterW / 4;  // fast motion at first, slows after 5 tiles

// General layout
this.setupRackEtc();
var hSpacing = 110, vSpacing = 48;
this.setupBoxes(hSpacing, vSpacing);
this.setupButtons(hSpacing, vSpacing);
this.setupMultipliers(letter);
this.gameOver = true;
if (makeCleanForDownload) return;  // Exit before instantiating letter morphs

this.gameOver = false;
this.setupLetterSource(letter);

// Load the first letter
letter = this.letterSource.shift();
letter.align(letter.bounds().bottomRight(), this.beltR.topRight().addXY(0,-3));
letter.loc = "belt";
this.activeLetters = [letter];
this.outboxLetters = [];
this.addMorphBack(letter);
// load a dropping letter in the bin...
letter = this.letterSource.shift();
this.letterInBin = letter;
this.addMorphBack(letter);
this.focus();

// if (! (this.owner instanceof WindowMorph)) this.putMeInAWindow(this.getPosition());
this.startStepping(1000/this.ticksPerSec, "tick"); // and away we go...;
}

