418.source:
function tick() {
    // Note: the letter blocks pass through several phases of behavior
    //		.loc == null -- 	in bin or not yet in service
    //		.loc == "belt" -- on the belt
    //		.loc == "rack" -- on the rack
    //		.loc == "falling" -- falling off the left edge (not yet used)
	if (this.paused || (this.gameOver && this.fallingLetters.length==0)) return;
	this.pulley.rotateBy(-Math.PI/15);
	this.pulley2.rotateBy(-Math.PI/15);
	if (this.activeLetters.length == 4) {
		this.xStep = - this.letterW / this.ticksPerSec;  // slow to normal pace on 5th tile
	}
	if (this.letterInBin) this.letterInBin.moveBy(pt(0, 0.3));  // letter in bin creeps down
	if (this.fallingLetters.length>0)
            this.fallingLetters.clone().forEach(function (ea) { this.letterFallToPile(ea) }, this);  // unused letter falls to pile
	if (this.activeLetters.length == 0) return;
	var letter = this.activeLetters[0];  // Will be on the belt
	letter.moveBy(pt(this.xStep, 0));

	// Drop letter from belt to rack, and then drop anew one onto belt
	if (letter.bounds().topRight().x < this.rack.bounds().topRight().x) this.letterDropOntoRack(letter);

	// Propagate leftward motion along rack when letters touch
	this.lettersSlideOnRack();

	// If leftmost letter is off rack then drop it
	if (this.activeLetters.last().bounds().center().x < this.rack.bounds().topLeft().x) this.letterFallOffEnd();
}

421.source:
function onKeyDown(evt) {
	if (this.paused) return;
	evt.stop();
        switch (evt.getKeyCode()) {
		case 8:   this.doDelete(true); return;
		case 27:   this.doClear(true); return;
		case 13:  this.doEnter(true); return;
	}
	// Normal letter keys...
	var char = evt.getKeyChar();
	if (char == '!') return;
	var letter = this.findCharOnRack(char.toUpperCase());
	if (letter) this.addToOutbox(letter);
}

