434.source:
function updateOutbox() {
	// Lay out outbox letters beginning at index = start
	this.letterScore = 0;
	var nLetters = this.outboxLetters.length;
	for (var i=0; i<nLetters; i++) {
		var letter = this.outboxLetters[i];
		var letterValue = 0;
		this.letterScore += this.letterValue(letter.textString);  // Later the letter-value
		letter.setPosition(this.outbox.bounds().topLeft().addXY(i*(this.letterW)+3, 1-(this.letterH)));
	}
	for (var i=0; i<this.rackSize; i++) this.fillLetter(this.multBoxes[i], Color.gray);
	if (nLetters > 0) this.fillLetter(this.multBoxes[nLetters-1], Color.blue);
	this.letterScoreBox.setTextString(this.letterScore.toString());
	this.wordScore = this.letterScore*this.multipliers[nLetters];
	this.wordScoreBox.setTextString(this.wordScore.toString());
}

437.source:
function shuffle(inp) {
    // Return a shuffled copy of the input array
    var shuffled = inp.slice(0);  // shuffleable copy
    for (var i=0; i<shuffled.length; i++) {
        var j = Math.floor(Math.random()*shuffled.length);
        var t = shuffled[i]; shuffled[i] = shuffled[j]; shuffled[j] = t;
    }
    return shuffled;
}

440.source:
function shuffledLetters(letters) {
    // This method avoids frustrating groups of many vowels
    // or consonants in a row.  It picks the letters at random
    // but maintains the vowel/consonant ratio constant.
    // Makes a much better game!
    var vowels = [];
    var consonants = [];
    for (var i=0; i<letters.length; i++) {
        if ('AEIOUaeiou'.include(letters[i])) vowels.push(letters[i]);
		else consonants.push(letters[i]);
    }
    vowels = this.shuffle(vowels);
    consonants = this.shuffle(consonants);
    var mixed = [];
    var ratio = vowels.length / (vowels.length + consonants.length);
    while (vowels.length > 0 && consonants.length > 0) { 
        // Assemble letters according to their overall ratio
        if ( (vowels.length / (vowels.length + consonants.length)) > ratio) mixed.push(vowels.pop());
            else mixed.push(consonants.pop());
    }
    // pick up any leftovers
    return mixed.concat(consonants, vowels);
}

