function doPause(val) {
	this.paused = val;
	this.pauseButton.setLabel( this.paused ? "resume" : "pause" );

	// If pausing, blank out all moving letters;  if un-pausing, then restore them
	var backGroundFill = Color.veryLightGray;  // reading fill from text does not work
	var ifInBin = (this.letterInBin ? [this.letterInBin] : []);
		ifInBin.concat(this.outboxLetters, this.fallingLetters, this.activeLetters).each( 
			function (letter) {
				if (this.paused) letter.colorBeforePause = letter.getBorderColor();  // save color when pause
				this.fillLetter(letter, ( this.paused ? backGroundFill : letter.colorBeforePause ) );  // blank or restore
			}.bind(this)); 
    this.focus();

}

