452.source:
function doDelete(val) {
	if (!val) return;
	// Delete key or button -- delete last letter from outbox and restore original
	if (this.outboxLetters.length == 0) return;
	this.removeFromOutbox(this.outboxLetters.pop());
	this.updateOutbox();
}

455.source:
function doClear(val) {
	if (!val) return;
	// Tab key or clear button -- means to delete all letters in outbox
	while (this.outboxLetters.length > 0) 
		this.removeFromOutbox(this.outboxLetters.pop());
	this.updateOutbox();
}

458.source:
function doEnter(val) {
	// Enter key or button -- means to submit this word from outbox
	// First gather the word
	if (!val) return;
	var word = "";
	for (var i=0; i<this.outboxLetters.length; i++) {
		var letter = this.outboxLetters[i];
		word += letter.textString;
		// remove letters from rack
		var original = letter.original;
		var ix = this.activeLetters.indexOf(original);
		this.activeLetters.splice(ix,1);
		original.remove();
		this.removeFromOutbox(letter);
	}
	// Check validity of word and make log entry
	var valid = this.lookupWord(word.toLowerCase());
	if (word.length == 1 && !"AIO".include(word)) valid = false;  // only three 1-letter "words"
	var scoreLine = this.wordScore.toString() + "\t " + word + "\n"
	var noCheck = URL.source.getQuery()['noCheck'];
	if (! valid) scoreLine = noCheck ? this.wordScore.toString() + "\t " + word + " ?? \n"
					: "-" + this.letterScore.toString() + "\t " + word + " ?? \n" ;
	if (this.usedWords.include(word)) {
		scoreLine = "0" + "\t " + word + "(" + this.wordScore.toString() + ") xx \n";
		valid = false;
	}
	if (valid) this.usedWords.push(word);  // remember for later checks

	// Post log entry and total score and reset outbox
	this.prepareColumn2or3();  // Allow many lines in log
	this.nLinesInLog++;
	this.wordLog.setTextString(this.wordLog.textString.concat(scoreLine));
	if (valid || noCheck) this.totalScore += this.wordScore;
	if (!valid && !noCheck) this.totalScore -= this.letterScore;
        this.pointsUsed += this.letterScore;
        this.showMultiplier();
	this.totalScoreBox.setTextString(this.totalScore.toString());
	if ((valid || noCheck) && this.wordScore > this.bestWordScore) {
		this.bestWordScore = this.wordScore;
		this.bestWordBox.setTextString(this.bestWordScore.toString());
		this.bestWord = word;
		this.bestWordLetters.setTextString(this.bestWord);
	}
	this.outboxLetters = [];
	this.updateOutbox();
}

461.source:
function findCharOnRack(char) {
    // If a given char is in rack, return the letterMorph, else null
    for (var i=0; i<this.activeLetters.length; i++) {
        var letter = this.activeLetters[i];
	if (letter.textString == char && letter.copyInOutbox == null && letter.loc == "rack") return letter
	}
    return null;
}

464.source:
function doLoadWordList(hugeArray) {
    // load the word list by pasting a huge array and evalling, eg
    // this.doLoadWordList(['AA', 'AAH', 'AAHED', 'AAHING']).last()
    // The current word list is TWL cited at
    // http://www.isc.ro/en/commands/lists.html and
    // http://en.wikipedia.org/wiki/Tournament_Word_List
    this.wordList = hugeArray.select(function(w) {return w.length<=9});
    this.wordList = this.wordList.map(function(w) {return w.toLowerCase()});
    return this.wordList;
}

467.source:
function letterSet(nLetters) {
    // Compute the letter set from probabilities and nLetters, the number desired
    var probs = {E: 12.02, T: 9.10, A:8.12, O: 7.68, I: 7.31, N: 6.95, S: 6.28, R: 6.02, H: 5.92, D: 4.32, L: 3.98, U:2.88, C: 2.71, M: 2.61, F: 2.30, Y: 2.11, W: 2.09, G: 2.03, P: 1.82, B: 1.49, V: 1.11, K: 0.69, X: 0.17, Q: 0.11, J: 0.10, Z: 0.07};
    var letters = [];
    Properties.own(probs).sort().each(function (letr) {
        var n = Math.max(1, Math.floor(probs[letr]/100*nLetters));
        if (letr == "U") n = 4;  // Need hep for Q
	for (var i=1; i<=n; i++) letters.push(letr);
    });
    return letters;
}

470.source:
function addToOutbox(letter) {
    // clone the corresponding letter in rack, and place in outbox
	if (letter.copyInOutbox != null) return;  // ignore clicks on letters in use
	var outLetter = this.addMorph(letter.duplicate());
	outLetter.original = letter;  // link it back to its original
	outLetter.onMouseDown = function (evt) {};  // Prevents show cursor if click
	letter.copyInOutbox = outLetter;
	this.fillLetter(letter, Color.gray);  // grey out the original
	this.outboxLetters.push(outLetter);
	this.updateOutbox();
}

473.source:
function lettersSlideOnRack() {
	for (var i=0; i < this.activeLetters.length-1; i++) {
		var letter = this.activeLetters[i];
		var let2 = this.activeLetters[i+1];
		// this delta keeps borders separate (gray belt letter and black rack letter)
		var deltaX = let2.bounds().topRight().x - letter.bounds().topLeft().x; 
		if (deltaX < 0) return;
		// Letter on rack bumped into another to the left
		// tweaked so borders merge on the rack 
		let2.moveBy(pt(-(deltaX)+1, 0));
	}
}

476.source:
function letterDropOntoRack(letter) {
	// Drop belt letter onto rack
	if (letter.loc != "rack") {
		letter.align(letter.bounds().bottomRight(), this.rack.bounds().topRight().addXY(-3,1));
		this.fillLetter(letter, Color.black);
		this.lettersSlideOnRack();
		letter.loc = "rack";
		// attach same code as typing that letter
		letter.onMouseDown = function (evt) { this.addToOutbox(letter); }.bind(this);
		}
	// Drop a new letter onto belt
	if (this.letterInBin) {
		// Drop letter onto belt from letterInBin
		var newLetter = this.letterInBin;
		newLetter.loc = "belt";
		newLetter.align(newLetter.bounds().bottomRight(), this.beltR.topRight());
		this.activeLetters.unshift(newLetter);
		newLetter.onMouseDown = function (evt) {};  // Prevents show cursor if click

		// Supply new letterInBin from letterSource
		this.letterInBin = (this.letterSource.length>0) ? this.addMorphBack(this.letterSource.shift()) : null;
		this.nLeftBox.setTextString(this.letterSource.length.toString());
                this.nLeftBox.applyStyle({align: 'center'});
	}
}

479.source:
function letterFallToPile(letter) {
    // Animate a rotating fall;
    letter.moveBy(letter.vel);
    letter.vel = letter.vel.addXY(0, 1);  // accelerated drop
    letter.rotateBy(letter.rot);

    letter.owner.addMorph(letter);

    // Below a certain y, stop its motion, but leave it in the world
    // We also need to keep score of the dropped letters
    //  -- let's make them land on top of the negative score box
    if (letter.bounds().bottomRight().y > 300) {
        this.fallingLetters.shift();
    }
}

482.source:
function setupLetterPrototype(borderWidth) {
	this.letterW = 45;
	this.letterH = 50;
        // Letter prototype...
	var letter = new lively.morphic.Text(new Rectangle(0, 0, this.letterW, this.letterH), 'W');
	letter.takesKeyboardFocus = Functions.False;
	letter.setFontSize(24);
	letter.setBorderWidth(borderWidth);
	letter.applyStyle({align: 'center'});

	letter.valueBox = new lively.morphic.Text(new Rectangle(10, 10, 30, 10), '10');
	letter.valueBox.setFontSize(8);
	letter.valueBox.applyStyle({align: 'right'})
	letter.valueBox.setFill(null);
	letter.valueBox.setBorderWidth(0);
	letter.valueBox.fitWidth();
	letter.addMorph(letter.valueBox);
	letter.valueBox.align(letter.valueBox.bounds().bottomRight(), letter.bounds().bottomRight().addXY(-2, -7));
	letter.valueBox.ignoreEvents();
	return letter;
}

485.source:
function setupRackEtc() {
	var rackR = new Rectangle(130,120, this.rackSize*this.letterW + 6, 5);
	this.rack = this.addMorph(lively.morphic.Morph.makeRectangle(rackR));
	this.outbox = this.addMorph(lively.morphic.Morph.makeRectangle(rackR.translatedBy(pt(0,70))));
	this.beltR = rackR.topRight().addXY(7, -5).extent(pt(this.beltSize*this.letterW, 2));
	var belt = this.addMorph(lively.morphic.Morph.makeRectangle(this.beltR));
		this.addMorph(belt.duplicate().translateBy(pt(0,16)));
	var r = 9;
	this.pulley = this.addMorph(lively.morphic.Morph.makeCircle(this.beltR.topLeft().addXY(0,r), r, 2, Color.black, Color.green))
		var c = this.pulley.innerBounds().center();
                for (var a=0; a<Math.PI; a+=Math.PI/3) {
			var line = lively.morphic.Morph.makeLine([c.addPt(Point.polar(r, a)), c.addPt(Point.polar(r, a+Math.PI))], 1, Color.black);
			this.pulley.addMorph(line);
		}
		this.pulley2 = this.addMorph(this.pulley.duplicate().translateBy(pt(belt.bounds().width, 0)));

	var binVerts = [pt(0,0), pt(80, 0), pt(62, 30), pt(18, 30)];
	this.bin = this.addMorph(lively.morphic.Morph.makePolygon(binVerts, 1, Color.black, Color.green.lighter().lighter()));
	this.bin.align(this.bin.bounds().topRight(), pt(belt.bounds().topRight().x + 23, -4));

	this.pilePlace = this.addMorph(lively.morphic.Morph.makeRectangle(30, 324, rackR.x - 60, 3));
}

488.source:
function setupButtons(hSpacing, vSpacing) {
	var buttonHeight = 22;
	var r = this.bestWordLetters.bounds().translatedBy(pt(4, vSpacing)).withHeight(buttonHeight);

	this.pauseButton = this.addMorph(new lively.morphic.Button(r)).setLabel("pause");
        this.pauseButton.label.moveBy(pt(0, 3));
	this.pauseButton.takesKeyboardFocus = Functions.False;  // Bad things happen if the buttons get focus
	this.pauseButton.toggle = true;

    this.restartButton = this.addMorph(this.pauseButton.duplicate().translateBy(pt(0, vSpacing)));
