function setupMultipliers(letter) {
	this.multipliers = [0, 0, 0, 1, 2, 3, 4, 5, 6, 7];  // start multiplier bonus at 4 letters
	this.multBoxes = [];
	var multBox = letter.duplicate();
	multBox.valueBox.remove();
	multBox.setFontSize(16);
	var e = multBox.bounds().extent();
	multBox.setExtent(pt(e.x-5, e.y-18));
	this.fillLetter(multBox, Color.gray);
	for (var i=0; i<this.rackSize; i++) {
		var dup = multBox.duplicate();
		dup.setTextString('x' + this.multipliers[i+1].toString());
                dup.applyStyle({align: 'center'});
		this.outbox.addMorph(dup);
		dup.setPosition(pt(i*this.letterW + 5, 6));
		this.multBoxes.push(dup);
	}
}

