function letterFallOffEnd() {
	// Last letter has fallen off the rack
	var letter = this.activeLetters.pop();
	if (letter.copyInOutbox) {
		// We are about to drop a letter that is used in the outbox
		var other = this.findCharOnRack(letter.textString);
		if (other) {
			// Found another of same letter -- switch outbox letter to use it
			other.copyInOutbox = letter.copyInOutbox;
			other.copyInOutbox.original = other;
			this.fillLetter(other, Color.gray);
		} else {
		var ix = this.outboxLetters.indexOf(letter.copyInOutbox);
		this.outboxLetters.splice(ix,1);
		letter.copyInOutbox.remove();
		this.updateOutbox(0);
		}
	}
	if (letter.textString == "!") {
            this.gameOver = true;
            this.postFinalScore();
            letter.remove();
            return;
	}
        // Score the lost dropped letter
        this.nMissed ++;
        this.pointsMissed += this.letterValue(letter.textString);
        this.missedPointsBox.setTextString((-this.pointsMissed).toString());
        this.totalScore -= this.letterValue(letter.textString);
        this.totalScoreBox.setTextString(this.totalScore.toString());
        this.showMultiplier();


	// Now set up the morph to animate falling onto a pile
	//while (this.letterFalling) this.letterFallToPile(this.letterFalling);  // make sure previous has landed
	letter.ignoreEvents();  // hopefully reduce some cpu use
	letter.moveBy(pt(-8, 0));
	this.fillLetter(letter, Color.gray);
	letter.onMouseDown = function (evt) {};  // No longer clickable
	letter.vel = pt(-3 + (Math.random()*0.5), 0);
	letter.rot = -0.1 + (Math.random()*0.05);
	this.fallingLetters.push(letter);
	letter.bringToFront();  // make it frontmost so see it land in pile;
}

