528.source:
function compactStringFromArray(wordArray) {
// [3,1,4,1,5,9] == [3,1,4,1,5,9] // test array equality
// This code produces a compact form of a sorted list of words.
// [It may work if thelist is not sorted, but no guarantees]
// For the 70k array with 516k of words in QBF it produces
// a single string of length 225k with no array overhead.
// For example:
//  this.compactStringFromArray(this.wordList).slice(0,70)
//  <0>a<1>bilities<6>y<2>le<2>out<3>ve<2>sence<3>olute<2>use<1>cademic<2>...
// Note: the character codes for A-Z are used for counts so there must
//    be no capital letters and no words longer than 26 characters
var charOffset = "A".charCodeAt(0);  // stop codes begin at 65
var s = "", prevWord;
var match = function(a, b) {
    // Return the number of leading characters in a and b that match
    for (var i=0; i<Math.min(a.length, b.length); i++) { if (a[i] != b[i]) return i; }
    return Math.min(a.length, b.length);
    };
wordArray.forEach(function(w) {
    w = w.toLowerCase();
    if (prevWord) {
        var nSame = match(w, prevWord);
        s += String.fromCharCode(nSame+charOffset);
    }
    //s += "<" + nSame + ">";  // Makes the readable form above
    s += w.slice(nSame);
    prevWord = w;
    });
return s;
}

