534.source:
function lookupWord(word) {
    if (!this.wordList) return true;  // no list - anything goes
    if (this.wordList instanceof Array) return this.wordList.include(word);
    // if wordList is in compact form, then do a search...
    var found = false;
    this.compactStringForEach(this.wordList,
        function(w) { if (w == word) found = true; });
    return found;
}

537.source:
function compactStringForEach(str, func) {
// Operates like forEach, calling the function with all the encoded words
// Tests:
// this.compactStringToArray(this.compactStringFromArray(this.wordList)).length == this.wordList.length
// this.compactStringToArray(this.compactStringFromArray(this.wordList)).slice(0,9)
// this.wordList.slice(0,9)
// this.compactStringToArray(this.compactStringFromArray(this.wordList)).slice(71632)
// this.wordList.slice(71632)
var w = "", c = 0;
var charOffset = "A".charCodeAt(0),
    maxStopCode = charOffset+25;
for (var i=0; i<str.length; i++) {
    c = str.charCodeAt(i);
    //if (i<100) console.log(" " + i + " " + c + " " + w);
    if (c > maxStopCode) w += str[i];  // just a character - append it to w
    else { // it is a stop code
        func(w);  // call the func with the current word
        w = w.slice(0, c-charOffset);  // stop code = no. characters to retain
    }
}
func(w);  // call the func with the last word;
}

540.source:
function compactifyWordList(toCompact) {
// Converts the this.wordList to/from compact format *in place*
// this.compactifyWordList(true); this.wordList.length
// this.lookupWord('zoner')
// Encodes 113k 2-9 letter words in 338k characters!
if (this.wordList instanceof Array) {
    if (!toCompact) return;  // already an array
    this.wordList = this.compactStringFromArray(this.wordList);
    }
    else {
    if (toCompact) return;  // already compact
    this.wordList = this.compactStringToArray(this.wordList);
    }
}

