function showMultiplier() {
    // Display the mean multipier
    var mult = this.totalScore/(this.pointsMissed + this.pointsUsed);
    var str = mult.toPrecision(2);
    if (mult < 1) str = mult.toPrecision(1);
    if (mult < 0.1) str = '-';
