}

555.source:
function postScoresToServer() {  // this.postScoresToServer()
    if (!this.playerName) {
        this.doChoosePlayerName(this.postScoresToServer);
        return}

    // If server is available, fetch high scores
    var server = this.getServer(encodeURI("QBFScoresServer/" + this.playerName));
    var answer = server.get();
    if (!answer.status.isSuccess()) return;
    // console.log("server ok");

    var newScores = {
        bestGame: this.level.bestGameScore,
        bestWordScore: this.level.bestWordScore,
        bestWord: this.level.bestWord,
        time: new Date() };
    // console.log("newScores = " + JSON.stringify(newScores));

    var allScores = JSON.parse(answer.content);
    // console.log("allScores = " + JSON.stringify(allScores));
    var priorScores = allScores[this.level.caption];
    // console.log("priorScores = " + JSON.stringify(priorScores));

    // If no prior scores, then store the new scores to server
    if (!priorScores) {
        allScores[this.level.caption] = newScores;
        // console.log("allScores = " + JSON.stringify(allScores));
        answer = server.post(JSON.stringify(allScores), 'application/json');
        // console.log(answer.content);
        return; }

    // If no improvement, then return
    if (priorScores.bestGame >= newScores.bestGame
        && priorScores.bestWordScore >= newScores.bestWordScore) {
        // console.log('no improvement');
        return; }

    // Otherwise update the best parts and store back to server
    if (priorScores.bestGame < newScores.bestGame) {
        priorScores.bestGame = newScores.bestGame; }
    if (priorScores.bestWordScore < newScores.bestWordScore) {
        priorScores.bestWordScore = newScores.bestWordScore;
        priorScores.bestWord = newScores.bestWord; }
    priorScores.time = newScores.time;
    // console.log('posting json = ' + JSON.stringify(allScores));
    answer = server.post(JSON.stringify(allScores), 'application/json');
    // console.log(answer.content);
    // Update viewer if there
    if ($world.get('QBFScoresViewer')) $world.get('QBFScoresViewer').readServer();
    return;
}

