function doChoosePlayerName(callback) {
    var hasCallback = typeof(callback) == "function";
    var wasPaused = this.paused;
    console.log('callback = ' + callback + ", hasCallback = " + hasCallback);
    if (!hasCallback && !wasPaused) this.doPause(true);  // may need to pause/resume
